        try:
            if dates[i][-1].isdigit(): 
                dates[i] = datetime.datetime.strptime(dates[i], '%d %B %Y')
            else:
                dates[i] = datetime.datetime.strptime(dates[i]+" 1959", '%d %B %Y')
        except ValueError:
            continue

    filtered_dates = [date for date in dates if isinstance(date, datetime.datetime)]
    if not filtered_dates:
        return None

    max_date = max(filtered_dates)
    min_date = min(filtered_dates)

    duration = (max_date - min_date).days + 1
    return str(duration)
